show_drift_graph = (id, a1_series, a2_series) => {
    var ctx = document.getElementById(id).getContext('2d');
  
    var labels = []
    for(var i=1; i<=a1_series.length; i++) {
      labels.push(i);
    }
    
    var myChart = new Chart(ctx, {
        type: 'line',
  
        data: {
            labels: labels,
            datasets: [{
                fill: false,
                label: 'Dashed',
                label: 'Presence of A1',
                data: a1_series,
                borderColor: 'rgba(10, 20, 30, 1)',
  
            },
            {
                fill: false,
                label: 'Dashed',
                label: 'Presence of A2',
                data: a2_series,
                borderColor: 'rgba(255, 20, 30, 1)',
  
            }]
        },
        options: {
            scales: {
              xAxes: [{
              display: true,
              scaleLabel: {
                display: true,
                labelString: 'Generation'
              }
            }],
              yAxes: [{
                display: true,
                scaleLabel: {
                  display: true,
                  labelString: 'Frequency'
                },
                ticks: {
                    beginAtZero:true
                }
              }]
            },
            elements: { point: { radius: 0 } }
        }
    });
  }
  
  show_mutations_graph = (id, series) => {
    var ctx = document.getElementById(id).getContext('2d');
  
    var labels = []
    for(var i=1; i<=series.length; i++) {
      labels.push(i);
    }
  
    var myChart = new Chart(ctx, {
        type: 'line',
  
        data: {
            labels: labels,
            datasets: [{
                fill: false,
                label: 'Dashed',
                data: series,
                borderColor: 'rgba(10, 20, 30, 1)',
  
            }]
        },
        options: {
            scales: {
              xAxes: [{
              display: true,
              scaleLabel: {
                display: true,
                labelString: 'Generation'
              }
            }],
              yAxes: [{
                display: true,
                scaleLabel: {
                  display: true,
                  labelString: 'Number of different DNA sequences'
                },
                ticks: {
                    beginAtZero:true
                }
              }]
            },
            elements: { point: { radius: 0 } }
        }
    });
  }
  
  
  function draw_grid(data,colors) {
      var width = 600;
      var height = 600;
      var grid_length = data.length;
  
      var svg = d3.select('body').append('svg')
            .attr('width', width)
            .attr('height', height);
  
      var rw = Math.floor(width/grid_length);
      var rh = Math.floor(height/grid_length);
  
      var g = svg.selectAll('g')
              .data(data)
              .enter()
              .append('g')
              .attr('transform', function (d, i) {
                return 'translate(0, ' + (width/grid_length) * i + ')';
              });
  
      g.selectAll('rect')
              .data(function (d) {
                return d;
              })
              .enter()
              .append('rect')
              .attr('x', function (d, i) {
                return (width/grid_length) * i;
              })
              .attr('width', rw)
              .attr('height', rh)
              .attr('class',function(d) {
                return d;
              });
      if (!colors) {
        d3.selectAll(".A1A1").style("fill","#fff");
          d3.selectAll(".A1A2").style("fill","#2176c9");
          d3.selectAll(".A2A2").style("fill","#042029");
      }
      else {
          for (var i = 0; i < colors.length; i = i + 2) {
              d3.selectAll("."+colors[i]).style("fill",colors[i+1]);  
          }
      }
  }
  
  function update_grid(data,colors){
      var grid_length = data.length;
      d3.select('svg').selectAll('g')
          .data(data)
          .selectAll('rect')
          .data(function (d) {
            return d;
          })
          .attr('class',function(d) {
            return d;
          });
      if (!colors) {
        d3.selectAll(".A1A1").style("fill","#fff");
          d3.selectAll(".A1A2").style("fill","#2176c9");
          d3.selectAll(".A2A2").style("fill","#042029");
          d3.selectAll(".N1").style("fill","#006400");
      }
      else {
          for (var i = 0; i < colors.length; i = i + 2) {
              d3.selectAll("."+colors[i]).style("fill",colors[i+1]);  
          }
      }
  }
  
  
